import React from 'react';
import ReactDOM from 'react-dom';
import "./index.css";

const curHour = new Date().getHours();
let greeting = '';

if(curHour >= 1 && curHour < 12) {
    greeting = "Morning";
}

if(curHour > 12 && curHour < 19) {
    greeting = "Afternoon";
}

else {
    greeting = "Night";
}

ReactDOM.render(
    <>
        <h1>Challenge-3</h1>
        <h2>Hello sir, Good {greeting} !!!</h2>
    </>,
    document.getElementById('root')
);
